sources.styles/utils/mixins.scss:
@mixin onTablet {
  @media (min-width: 640px) {
    @content;
  }
}

@mixin onDesktop {
  @media (min-width: 1024px) {
    @content;
  }
}

@mixin onXlDesign {
  @media (min-width: 1200px) {
    @content;
  }
}


@mixin contentPaddingInline() {
  padding-inline: 16px;

  @include onTablet {
    padding-inline: 44px;
  }
}

